                                    style="width: 98%;" ;="">
                                    <span class="tiredindex-class text-white">98%</span>
                                </div>
                            </div>
                        </div>
                    </div>

                    <div id="checkzone" class="checkzone" style="display: block;">
                        <span class="waitingtext1">어디가 그렇게 피곤해보여?</span>
                        <button class="rounded rounded-bl border py-2 px-4 m-2 checkresult" onclick="showzone();">상세
                            보기</button>
                    </div>



                    <div id="zoneindex" class="zoneindex" style="display: none;">
                        <div><button class="rounded rounded-bl border py-2 px-4 m-2 checkresult"
                                onclick="slideupzone();">상세
                                닫기</button></div>
                        <div class="zoneestimate"><span>눈가 피로(다크서클, 눈주름 등)</span></div>
                        <div id="label-container" class="flex flex-col justify-between items-center">
                            <div class="w-full flex flex-row justify-between items-center my-3">
                                <div class="w-3/12"><span class="tiredindex-class">눈가 피로</span></div>
                                <div class="w-9/12 h-5 rounded rounded-lg red">
                                    <div id="zone1" name="92"
                                        class="px-3 h-5 rounded rounded-lg flex flex-row items-center justify-center redbar"
                                        style="width: 0%;">
                                        <span class="tiredindex-class text-white">92%</span>
                                    </div>
                                </div>
                            </div>
                            <div class="w-full flex flex-row justify-between items-center my-3">
                                <div class="w-3/12"><span class="tiredindex-class">피부 피로</span></div>
                                <div class="w-9/12 h-5 rounded rounded-lg green">
                                    <div id="zone2" name="7"
                                        class="px-3 h-5 rounded rounded-lg flex flex-row items-center justify-center greenbar"
                                        style="width: 0%;">
                                        <span class="tiredindex-class text-white">7%</span>
                                    </div>
                                </div>
                            </div>
                            <div class="w-full flex flex-row justify-between items-center my-3">
                                <div class="w-3/12"><span class="tiredindex-class">얼굴 붓기</span></div>
                                <div class="w-9/12 h-5 rounded rounded-lg gray">
                                    <div id="zone4" name="1"
                                        class="px-3 h-5 rounded rounded-lg flex flex-row items-center justify-center graybar"
                                        style="width: 0%;">
                                        <span class="tiredindex-class text-white">1%</span>
                                    </div>
                                </div>
                            </div>
                            <div class="w-full flex flex-row justify-between items-center my-3">
                                <div class="w-3/12"><span class="tiredindex-class">기미 잡티</span></div>
                                <div class="w-9/12 h-5 rounded rounded-lg gray">
                                    <div id="zone3" name="0"
                                        class="px-3 h-5 rounded rounded-lg flex flex-row items-center justify-center graybar"
                                        style="width: 0%;">
                                        <span class="tiredindex-class text-white">0%</span>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="gettips mt-5 underline"><span>눈가 피로(다크서클, 눈주름 등) 해소하기!</span></div>
                    </div>

                </div>
            </div>
        </div>
        <!--여기까지 드래그앤드롭-->
    </div>
